import webapp2
import jinja2
import os
import datetime
import json

jinja_environment = jinja2.Environment(
    loader=jinja2.FileSystemLoader(os.path.dirname(__file__)))

title = 'Bikes Against The Machine'
data = {
    "id":1,
    "lat":48.65592598,
    "lng":6.1557130600000005,
    "radius":65,
    "comment":"Test ",
    "date":1351708069467,
    "photo":""
}

class PhotoApi(webapp2.RequestHandler):
    def get(self):
        self.response.headers['Content-Type'] = 'application/json; charset=UTF-8'
        self.response.write('[' + json.dumps(data) + ']')

class HomePage(webapp2.RequestHandler):
    def get(self):
        template_values = {
            'title': title,
            'page' : 'home',
            'content': open(os.path.dirname(__file__) + '/part_home.html', 'r').read(),
        }

        template = jinja_environment.get_template('template.html')
        self.response.headers['Content-Type'] = 'text/html; charset=UTF-8'
        self.response.out.write(template.render(template_values))

class PhotoPage(webapp2.RequestHandler):
    def get(self, photo_id):
        photo_datetime = datetime.datetime.now()
        photo_datetime_formatted = photo_datetime.strftime("%d/%m/%y") + ' a ' + photo_datetime.strftime("%H:%M:%S")
        content = jinja_environment.get_template('part_photo_fb.html').render({
            'imageData' : data["photo"],
            'date' : 'le ' + photo_datetime_formatted,
            'comment': 'trop top',
        })
        page = jinja_environment.get_template('template.html').render({
            'title' : title + ' - la photo du boulet du ' + photo_datetime_formatted,
            'page' : 'photo-' + photo_id,
            'content' : content,
        })
        self.response.headers['Content-Type'] = 'text/html; charset=UTF-8'
        self.response.out.write(page)

class GoodiesPage(webapp2.RequestHandler):
    def get(self):
        template_values = {
            'title': title + ' - Goodies',
            'page' : 'goodies',
            'content': open(os.path.dirname(__file__) + '/part_goodies.html', 'r').read(),
        }

        template = jinja_environment.get_template('template.html')
        self.response.headers['Content-Type'] = 'text/html; charset=UTF-8'
        self.response.out.write(template.render(template_values))

class AboutPage(webapp2.RequestHandler):
    def get(self):
        template_values = {
            'title': title + ' - About',
            'page' : 'about',
            'content': open(os.path.dirname(__file__) + '/part_about.html', 'r').read(),
        }

        template = jinja_environment.get_template('template.html')
        self.response.headers['Content-Type'] = 'text/html; charset=UTF-8'
        self.response.out.write(template.render(template_values))

app = webapp2.WSGIApplication([('/api/photo', PhotoApi), ('/', HomePage), ('/photo/(\d+)', PhotoPage), ('/goodies', GoodiesPage), ('/about', AboutPage)],
                              debug=True)
